import React from 'react'
import { Formik } from 'formik'

interface registerProps {}

export const Register: React.FC<registerProps> = ({}) => {
    return (
        <Formik
            initialValues={{ username: '', password: '' }}
            onSubmit={(values) => {
                console.log(values)
            }}>
            {() => (
                <Form>
                    <div>Hello</div>
                </Form>
            )}
        </Formik>
    )
}

export default Register
